export const placeReducer = async (state, action) => {
    switch (action.type) {
        case 'SHOW_PLACES':
            const googlePlacesApi = process.env.REACT_APP_GOOGLE_PLACES_API_KEY;
            const response = await fetch(`/place/textsearch/json?query=restaurant+berlin&key=${googlePlacesApi}`)
            console.log(response);
            const data = await response.json();
            console.log(data.results)
            return {
                ...state,
                number: action.place.columnsCount,
            }
        default:
            return state;
    }
}
